import styled from 'styled-components';
// import { } from 'styled-system';

export const MainBanner = styled.div`
    display: flex;
    padding: 0px 50px;
    height: 100vh;
    background-color: red;
`;

export const Title = styled.span`
    color: #fff;
    font-size: 80px;
`;
